Of the 3,027 children with known DENV infection histories, 2,659 children contributed paired annual serum samples for 2016 and 2017 and were thus included in the ZIKV infection analysis. Of these children, 574 (21.6%) had 1 or more prior DENV infections, 134 (5%) had experienced a recent DENV infection, and 2,085 (78.4%) were DENV-na誰ve (
 S2 Table). In multivariable Poisson models, the rate of ZIKV infection was not significantly associated with prior DENV infection status when adjusted for age, sex, and recent DENV infection (IRR: 0.98; 95% CI: 0.82, 1.16; 
 p = 0.809). Further, among ZIKV infections, children with prior DENV infection had 0.62 (95% CI: 0.44, 0.86; 
 p = 0.004) times the rate of symptomatic Zika presentation compared to DENV-na誰ve children when adjusted for recent DENV infection, age, and sex (
 Table 3). Among ZIKV infections, primary DENV immunity was associated with a decreased rate of symptomatic ZIKV infection compared to being DENV-na誰ve (IRR: 0.56, 95% CI: 0.38, 0.83; 
 p = 0.004). While secondary DENV immunity was not significantly associated with symptomatic Zika (IRR: 0.66, 95% CI: 0.44, 1.01; 
 p = 0.056) compared to being DENV-na誰ve, the point estimate was similar to that of primary DENV immunity.
